import React, { useState } from 'react';
import '../css/Member_search.css';

const MemberSearch = () => {
    const [email, setEmail] = useState('');
    const [name, setName] = useState('');
    const [id, setId] = useState('');

    return (
        <div className='search-background'>
            <div className='search-form'>
                <div className='header'>
                    <img src={require('../image/gunlogo.png')} alt="로고" className='search-logo'/>
                    <div style={{ fontSize: '40px', fontWeight: 'bold', marginLeft: '10px' }}>아이디/비밀번호 찾기</div>
                </div>
                <div style={{ fontSize: '15px', color: 'white', marginTop: '-50px', marginRight: '350px' }}>
                    회원 아이디와 비밀번호를 잊으셨나요?
                </div>
                <br></br>
                <br></br>
                <div style={{ borderBottom: '2px solid black', marginTop: '5px', width: '100%' }}></div>
                <div>아이디 찾기</div>
                <div>
                    <input
                    type="name"
                    id="name"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    className='search-name'
                    placeholder='이름을 입력해주세요'
                    required
                    />
                    <input
                    type="email"
                    id="email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    className='search-email'
                    placeholder='이메일 입력해주세요'
                    required
                    />  
                </div>
                <div>비밀번호 찾기</div>
                    <input
                    type="id"
                    id="id"
                    value={id}
                    onChange={(e) => id(e.target.value)}
                    className='search-id'
                    placeholder='아이디를 입력해주세요'
                    required
                    />
                    <input
                    type="name"
                    id="name"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    className='search-name'
                    placeholder='이름을 입력해주세요'
                    required
                    />
                    <input
                    type="email"
                    id="email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    className='search-email'
                    placeholder='이메일 입력해주세요'
                    required
                    />  
                    

            </div>
        </div>
    ); 
};

export default MemberSearch;
